import math

def is_prime(n):
    if n <= 2:
        return False
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True

def find_prime_pairs(num):
    prime_pairs = set()
    for i in range(2, num - 1):
        if is_prime(i):
            j = num - i
            if is_prime(j):
                prime_pairs.add(tuple(sorted((i, j))))
    return prime_pairs

